import React from "react";

const AdminDashboard = () => {
  return (
    <div style={{ textAlign: "center", marginTop: "50px" }}>
      <h1>Admin Dashboard</h1>
      <p>Welcome, Admin! Here you can manage the application.</p>
    </div>
  );
};

export default AdminDashboard;
